BylawArticleSubsection.create!([
  {subsec_num: 1, title: "President", content: "The President shall be the chief executive officer and shall preside at all meetings of the Board of Directors.", bylaw_article_section_id: "46726b0b-22ec-43dd-9fd0-67cd9aba253d", bylaw_article_id: "93d06a15-8a73-4bf7-9e5a-a6c9aa972970"},
  {subsec_num: 2, title: "Vice President", content: "The Vice President shall perform the duties of the President in the absence of the President, and shall assist the office in the discharge of its leadership duties. The Vice President will automatically become President in the case of the President‚Äôs death, resignation, or removal from office.", bylaw_article_section_id: "46726b0b-22ec-43dd-9fd0-67cd9aba253d", bylaw_article_id: "93d06a15-8a73-4bf7-9e5a-a6c9aa972970"},
  {subsec_num: 3, title: "Secretary", content: "The Secretary shall give notice of all meetings of the Board of Directors, shall keep an accurate list of the directors, and shall have the authority to certify any records, or copies of records, as the official records of the organization. The Secretary shall maintain the minutes of the Board of Directors‚Äô meetings", bylaw_article_section_id: "46726b0b-22ec-43dd-9fd0-67cd9aba253d", bylaw_article_id: "93d06a15-8a73-4bf7-9e5a-a6c9aa972970"},
  {subsec_num: 4, title: "Treasurer", content: "The Treasurer shall be responsible for conducting the financial affairs of the organization as directed and authorized by the Board of Directors, and shall make reports of corporate finances as required, but no less often than at each meeting of the Board of Directors.\n", bylaw_article_section_id: "46726b0b-22ec-43dd-9fd0-67cd9aba253d", bylaw_article_id: "93d06a15-8a73-4bf7-9e5a-a6c9aa972970"}
])
Bylaw.create!([
  {title: "2021 Bylaws of the DeafBlind Support and Access Network", introduction: "The name of the organization is DeafBlind Support and Access Network. The organization is structured in accordance with the Connecticut Revised Nonstock Corporation Act, as amended. The organization has not been formed for the making of any profit, or personal financial gain. The assets and income of the organization shall not be distributable to, or benefit the officers or other individuals. The assets and income shall only be used to promote corporate purpose as described below. Nothing contained herein, however, shall be deemed to prohibit the payment of reasonable compensation to employees and independent contractors for the services provided for the benefit of the organization. This organization shall not carry on any other activities not permitted to be carried on by an organization exempt from federal income tax. The organization shall not endorse, contribute to, work for, or otherwise support (or oppose) a candidate for public office. The purpose of this organization is the following:\n\nThe mission of the DeafBlind Support and Access Network is to provide the DeafBlind community with access, education, support, and networking.\n\nThe organization is organized exclusively for purposes pursuant to section 501(c)(3) of the Internal Revenue Code.", status: "Draft", proposed: nil, approved: nil, current: false}
])
