BylawArticleSection.create!([
  {sec_num: 1, title: "Annual Meeting of the Director", content: "An annual meeting shall be held once every calendar year for the purpose of appointing directors and board members, and/or for the transaction of such other business as may properly come before the meeting. The annual meeting shall be held at the time and place designated by the Board of Directors. An annual meeting of the Board of Directors is not required to be held at a geographic location if the meeting is held by means of the internet or other electronic communication technology in a manner pursuant to which the members will have full access to the proceedings, pose questions, vote on matters, and make comments.", bylaw_article_id: "26b0edfb-211f-49f4-8945-410d208172bb"},
  {sec_num: 2, title: "Special Meetings", content: "Special meetings may be requested by the President or the Board of Directors. A special meeting of the Board of Directors is not required to be held at a geographic location if the meeting is held by means of the internet or other electronic communication technology in a manner pursuant to which the members will have full access to the proceedings, pose questions, vote on matters, and make comments. ", bylaw_article_id: "26b0edfb-211f-49f4-8945-410d208172bb"},
  {sec_num: 3, title: "Notice", content: "Written notice of all meetings shall be provided under this section or as otherwise required by law. The notice shall state the place, date, and hour of meeting, and if for a special meeting, the purpose of the meeting. Such notice shall be electronically mailed to all Directors of record, at least 5 days prior to the meeting. Such notice shall be deemed effective.", bylaw_article_id: "26b0edfb-211f-49f4-8945-410d208172bb"},
  {sec_num: 4, title: "Place of Meeting", content: "Meetings shall be held electronically through the internet, unless otherwise stated in the notice. Unless the bylaws provide otherwise, the Board of Directors may permit any or all directors to participate in a regular or special meeting by, or conduct the meeting through the use of, any means of communication by which all directors participating will have complete access to the proceedings during the meeting. A director participating in a meeting by this means shall be deemed to be present in person at the meeting. ", bylaw_article_id: "26b0edfb-211f-49f4-8945-410d208172bb"},
  {sec_num: 5, title: "Quorum", content: "A majority of the directors shall constitute a quorum at a meeting. In the absence of a quorum, a majority of the directors may adjourn the meeting to another time without further notice. If a quorum is represented at an adjourned meeting, any business may be transacted that might have been transacted at the meeting as originally scheduled. The directors present at a meeting represented by a quorum may continue to transact business until adjournment, even if the withdrawal of some directors results in representation of less than a quorum.", bylaw_article_id: "26b0edfb-211f-49f4-8945-410d208172bb"},
  {sec_num: 6, title: "Informal Action", content: "Any action required to be taken, or which may be taken, at a meeting, may be taken without a meeting and without prior notice if a consent in writing, setting forth the action so taken, is signed by the directors with respect to the subject matter of the vote.", bylaw_article_id: "26b0edfb-211f-49f4-8945-410d208172bb"},
  {sec_num: 1, title: "Number of Directors", content: "The organization shall be managed by a Board of Directors consisting of five (5) members. A majority of three (3) out of five (5) members must be DeafBlind.", bylaw_article_id: "90a90f56-2ce2-4902-86c8-07cb70d99223"},
  {sec_num: 2, title: "Appointment and Term of Office", content: "The directors shall be appointed at the annual meeting. Each director shall serve until a successor has been appointed and qualified.", bylaw_article_id: "90a90f56-2ce2-4902-86c8-07cb70d99223"},
  {sec_num: 3, title: "Quorum", content: "A majority of directors shall constitute a quorum.", bylaw_article_id: "90a90f56-2ce2-4902-86c8-07cb70d99223"},
  {sec_num: 4, title: "Adverse Interest", content: "In the determination of a quorum of the directors, or in voting, the disclosed adverse interest of a director shall not disqualify the director or invalidate their vote.", bylaw_article_id: "90a90f56-2ce2-4902-86c8-07cb70d99223"},
  {sec_num: 5, title: "Regular Meetings", content: "The Board of Directors shall meet immediately after being notified of an appointment for the purpose of appointing and qualifying its new officers, appointing new committee chairpersons and for transacting such other business as may be deemed appropriate. The Board of Directors may provide, by resolution, for additional regular meetings without notice other than the notice provided by the resolution.", bylaw_article_id: "90a90f56-2ce2-4902-86c8-07cb70d99223"},
  {sec_num: 6, title: "Special Meetings", content: "Special meetings may be requested by the President, Vice President, Secretary, or any two directors by providing five (5) days‚Äô written notice by electronic mail. Minutes of the meeting shall be sent to the Board of Directors within two weeks after the meeting. A special meeting of members is not required to be held at a geographic location if the meeting is held by means of the internet or other electronic communications technology in a manner pursuant to which the members will have full access to the proceedings, pose questions, vote on matters, and make comments. ", bylaw_article_id: "90a90f56-2ce2-4902-86c8-07cb70d99223"},
  {sec_num: 7, title: "Procedure", content: "The vote of a majority of the directors present at a properly called meeting at which a quorum is present shall be the act of the Board of Directors, unless the vote of a greater number is required by law or by these bylaws for a particular resolution. A director of the organization who is present at a meeting of the Board of Directors at which action on any corporate matter is taken shall be presumed to have assented to the action taken unless their dissent shall be entered in the minutes of the meeting. The Board shall keep written minutes of the proceeding in its permanent records.", bylaw_article_id: "90a90f56-2ce2-4902-86c8-07cb70d99223"},
  {sec_num: 8, title: "Informal Action", content: "Any action required to be taken at a meeting of directors, or of a committee of directors, may be taken without a meeting if a consent in writing setting forth the action so taken, is signed by all of the directors or all of the members of the committee of directors, as the case may be.", bylaw_article_id: "90a90f56-2ce2-4902-86c8-07cb70d99223"},
  {sec_num: 9, title: "Removal / Vacancies", content: "A director shall be subject to removal from the Board of Directors, with or without cause, at a meeting called for that purpose. Any vacancy that occurs on the Board of Directors, whether by death, resignation, removal or any other cause, may be filled by the remaining directors. A director appointed to fill a vacancy shall serve until a successor has been appointed and qualified.", bylaw_article_id: "90a90f56-2ce2-4902-86c8-07cb70d99223"},
  {sec_num: 10, title: "Commitment", content: "To the extent permitted by law, the Board of Directors may appoint from its members a committee or committees, temporary or permanent, and designate the duties, powers and authorities or such committees.", bylaw_article_id: "90a90f56-2ce2-4902-86c8-07cb70d99223"},
  {sec_num: 1, title: "Number of Officers", content: "The officers of the organization shall be a President, a Vice President, a Treasurer, and a Secretary.", bylaw_article_id: "93d06a15-8a73-4bf7-9e5a-a6c9aa972970"},
  {sec_num: 2, title: "Appointment and Term of Office", content: "The officers shall be appointed at the annual meeting. Each officer shall serve until a successor has been appointed and qualified.", bylaw_article_id: "93d06a15-8a73-4bf7-9e5a-a6c9aa972970"},
  {sec_num: 3, title: "Removal or Vacancy", content: "The Board of Directors shall have the power to remove an officer or agent of the organization. Any vacancy that occurs for any reason may be filled by the Board of Directors.", bylaw_article_id: "93d06a15-8a73-4bf7-9e5a-a6c9aa972970"}
])
